/** @jsx jsx */
import { css, jsx } from '@emotion/core';
import user from './user.svg';

export const UserIcon = () => (
  <img
    src={user}
    alt="User"
    css={css`
      width: 12px;
      opacity: 0.6;
    `}
  />
);
